# Gornoye, Republic of Bashkortostan

}}
Gornoye () is a rural locality (a village) in Urgushevsky Selsoviet, Karaidelsky District, Bashkortostan, Russia. The population was 30 as of 2010. There is 1 street.
Geography
Gornoye is located 43 km southwest of Karaidel (the district's administrative centre) by road. Urgush is the nearest rural locality.
